import { useState } from 'react'
import './Form.css'
function Form(){
    const[searchTerm, setSearchTerm]=useState("")
    let eventHandler= (e) =>{
      setSearchTerm({...searchTerm})

    }
    return(
        <form  className="form-header" onSubmit={(e) => e.preventDefault()}>
            <input onChange={eventHandler} className="input-header"  type="search" placeholder="search"  />
        </form>
    )
}
export default Form
